import {connect} from "react-redux";

import ProfileSettings from "./ProfileSettings";
import {changeConfirmPassword, changePassword, setPhotos} from "../../redux/ProfileSettingsReducer";

let mapStateToProps = (state) => {
  return {
    password: state.settings.password,
    confirmPassword: state.settings.confirmPassword,
    photos: state.settings.confirmPassword
  }
}

const ProfileSettingsContainer = connect(mapStateToProps, {
  changePassword, changeConfirmPassword, setPhotos
})(ProfileSettings);

export default ProfileSettingsContainer;
